            .login-box {
              /* background-color: rgba(
                255,
                255,
                255,
                1
              ); 
              padding: 30px;
              box-shadow: 0 4px 10px rgba(0, 0, 0, 0.1);
              border-radius: 8px;
              width: 300px;
              text-align: center; */
              background-image: none;
              background-repeat: no-repeat;
              background-size: contain;
              margin-left: auto;
              margin-right: auto;
              position: relative;
              max-width: 440px;
              width: calc(100% - 40px);
              padding: 44px;
              /* margin-bottom: 28px; */
              background-color: #fff;
              -webkit-box-shadow: 0 2px 6px rgba(0, 0, 0, 0.2);
              -moz-box-shadow: 0 2px 6px rgba(0, 0, 0, 0.2);
              box-shadow: 0 2px 6px rgba(0, 0, 0, 0.2);
              min-width: 320px;
              min-height: 360px;
              overflow: hidden;
            }
      
            .loginbox-cover {
                  background-color: white;
                  opacity:0;
                  filter: alpha(opacity = 0);
                  z-index: -1;
                  height: 100%;
                  width: 100%;
                  position: absolute;
                  display: none;
                  top: 0;
                  left: 0;
                  transition: all .5sease-in;
                  -o-transition: all .5s ease-in;
                  -moz-transition: all .5s ease-in;
                  -webkit-transition: all .5sease-in;
                  z-index: 2;
              }
      
            .loginForm {
              position: absolute;
              width: calc(100% - 85px);
              display: flex;
              flex-direction: column;
              justify-content: space-between;
              height: 250px;
              opacity: 1;
              transition: opacity .8s ease-out;
            }
      
            h2 {
              margin-bottom: 20px;
              font-size: 24px;
              color: #333;
      
              color: #1b1b1b;
              font-size: 1.5rem;
              font-weight: 600;
              padding: 0;
              margin-bottom: 12px;
              font-family: "Segoe UI", "Helvetica Neue", "Lucida Grande", "Roboto",
                "Ebrima", "Nirmala UI", "Gadugi", "Segoe Xbox Symbol",
                "Segoe UI Symbol", "Meiryo UI", "Khmer UI", "Tunga", "Lao UI", "Raavi",
                "Iskoola Pota", "Latha", "Leelawadee", "Microsoft YaHei UI",
                "Microsoft JhengHei UI", "Malgun Gothic", "Estrangelo Edessa",
                "Microsoft Himalaya", "Microsoft New Tai Lue", "Microsoft PhagsPa",
                "Microsoft Tai Le", "Microsoft Yi Baiti", "Mongolian Baiti", "MV Boli",
                "Myanmar Text", "Cambria Math";
            }
      
            .textbox {
              margin-bottom: 20px;
            }
      
            .textbox input {
              /* 
              padding: 10px;
              border: 1px solid #ccc;
              border-radius: 4px;
              font-size: 14px;
              box-sizing: border-box; */
      
              font-size: 14px;
              width: 100%;
              padding: 6px 10px;
              border-width: 1px;
              /* border-color: rgba(0, 0, 0, 0.6); */
              border-color: rgb(102, 102, 102);
              height: 36px;
              outline: none;
              border-radius: 0;
              -webkit-border-radius: 0;
              background-color: transparent;
              border-top-width: 0;
              border-left-width: 0;
              border-right-width: 0;
              padding-left: 0;
            }
      
            .textbox input:focus {
              outline: none;
              border-color: #4e8a8a;
            }
      
            .textbox input:hover {
              border-color: rgba(0, 0, 0, 0.8);
            }
      
            .btnHolder {
              display: flex;
              margin-top: 60px;
              width: 100%;
              justify-content: flex-end;
            }
      
            .btn {
              background-color: #0078d4;
              color: white;
              border: none;
              padding: 8px 40px;
              width: auto;
              cursor: pointer;
              font-size: 15px;
      
              color: #fff;
              border-color: #0067b8;
              background-color: #0067b8;
            }
      
            .btn:hover {
              background-color: #005a99;
            }
      
            .emh{
              display: flex;
              justify-content: flex-start;
              align-items: center;
              gap: 4px;
              font-size: 14px;
              margin-bottom: 10px;
          }
          
          .emh button{
              border-radius: 50px;
              display: flex;
              justify-content: center;
              align-items: center;
              border: none;
              background-color: transparent;
              transition: background-color .2s ease-out;
          }
          
          
            .emh button:hover{
              background-color: #e1e1e1;
            }
      
            .emh img{
              height: 24px;
              cursor: pointer;
            }
      
            .other-options {
              margin-top: 15px;
              font-size: 12px;
              color: #555;
            }
      
            #div1 {
              opacity: 1;
              transform: translateX(0);
              transition: opacity .8s ease-in-out, transform .2s ease-out;
              animation: div1Entry .5s ease;
            }
    
          @keyframes div1Entry {
            from{opacity: 0; transform: translateX(30%) ;}
            to{opacity: 1;transform: translateX(0) ;}
          }
      
          #div2 {
              opacity: 0;
              /* display: none; */
              transform: translateX(120%);
              transition: opacity .8s ease-in-out, transform .2s ease-out;
          }
      
            #errmsg{
                color: rgb(232, 17, 35);
                display: none;
                font-size: 15px;
            }
      
            /* Responsive design */
            @media (max-width: 600px) {
              .login-box {
                width: 80%;
                padding: 20px;
              }
            }
